import styled from 'styled-components'
import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import WordCard from '../components/Main/WordCard'
import { wordGetRequestAction } from '../reducers/word'
import DiaryList from '../components/Main/ViewList'
import { Row, Col } from 'antd'
import ViewList from '../components/Main/ViewList'
import LikedList from '../components/Main/LikedList'

// const Cards = styled.div`
//   background-color: #f9fafb;
//   height: 200px;
//   padding-bottom: 5%;
//   padding-top: 5%;
//   padding-left: 5%;
//   padding-right: 5%;
// `

function Main() {
  const dispatch = useDispatch()
  const { me } = useSelector((state) => state.user)

  useEffect(() => {
    if (me !== null) {
      console.log('me', me)
      dispatch(wordGetRequestAction({ userId: me.userId }))
    }
  }, [me])

  return (
    <>
      <WordCard />
      <Row>
        <Col span={8}>
          <h3>조회수</h3>
          <ViewList />
        </Col>
        <Col span={8}>
          <h3>좋아요</h3>
          <LikedList />
        </Col>
        <Col span={8}>
          <h3>댓글</h3>
          <DiaryList />
        </Col>
      </Row>
    </>
  )
}

export default Main
